import {
  SHOW_DIALOG,
  CLOSE_DIALOG
} from '../types';

// eslint-disable-next-line import/no-anonymous-default-export
export default (state, action) => {
  switch(action.type){   
    case SHOW_DIALOG: 
      return {
        ...state        
      }; 
    case CLOSE_DIALOG:
      return{
        ...state        
      }           
    default:       
      return state;
  }
}
